import gsap from "gsap";
import react, { useEffect, useState, useImperativeHandle } from "react";

const navHeader = () => {
  const [animation, setAnimation] = useState();
  const handleBack = () => {
    console.log("you click me");
  };
  useEffect(() => {
    const navTop = document.querySelectorAll(".nav-top");

    navTop[1].addEventListener("click", function(e) {
      e.preventDefault();
      tl.reverse(props);
      console.log(tl.reverse(props));
    });
  });
  return (
    <div className="nav-header">
      <div className="nav-name">Labidi.</div>
      <span className="space-between"></span>
      <div className="nav-links-top">
        <div>
          <a className="nav-top" href="/landingpage">
            Home
          </a>
        </div>
        <span className="space"></span>
        <a className="nav-top" onClick={this.handleBack} href="#">
          Back
        </a>
      </div>
      <style jsx>{`
        a,
        a:link {
          text-decoration: none;
          color: rgb(155, 152, 152);
        }
        .nav-header {
          display: flex;
          justify-content: space-evenly;
          align-items: baseline;
          font-size: 20px;
        }
        .nav-name {
          color: white;
          font-size: 30px;
        }
        .nav-links-top {
          display: flex;
        }
        .nav-links-top a {
          color: rgb(155, 152, 152);
          opacity: 0.5;
          position: relative;
          padding: 0;
          margin: 0;
        }
        .nav-links-top a:before {
          content: "";
          position: absolute;
          width: 0;
          height: 2px;
          bottom: 0;
          right: 0;
          background-color: #fff;
          visibility: hidden;
          transition: all 0.3s ease-in-out;
        }
        .nav-links-top a:hover:before {
          visibility: visible;
          width: 100%;
        }
        .nav-links-top a:hover {
          transform: scale(1.3);
          opacity: 1;
        }
        .space-between {
          width: 50%;
        }
        .space {
          width: 30px;
        }
      `}</style>
    </div>
  );
};

export default navHeader;
